import React from "react";

function PageLinks({ link, className, iconClassName, linkText }) {
  return (
    <>
      <li>
        <a href="{link}" className="{className}">
          <i className="{iconClassName}"></i>
          {linkText}
        </a>
      </li>
    </>
  );
}

export default PageLinks;
